import React from 'react';
import './App.css';
import { Typography } from 'antd';
import { Card } from "antd";

const { Title } = Typography;

function App() {
  return (
    <div>
      <Title>Steam Group Game Checker</Title>
      <Card title="Search for common games" extra={<a href="#">More</a>} style={{ width: 300 }}>

      </Card>
    </div>
  );
}

export default App;
